import React, { Component, Fragment } from 'react';
import { Wrapper, Dates, Location, RegisterButton } from './CampCard.styled.js';

class CampCard extends Component {
  constructor(props){
    super(props);
    this.state={};
  }

  render() {
    return (
      <Wrapper>
      <svg viewBox="0 0 500 500">
        <path id="curve" d="M73.2,148.6c4-6.1,65.5-96.8,178.6-95.6c111.3,1.2,170.8,90.3,175.1,97" />
        <text width="500">
          <textPath>
            Dangerous Curves Ahead
          </textPath>
        </text>
      </svg>
        <Dates>{this.props.dates}7</Dates>
        <Location>{this.props.location}</Location>
        <RegisterButton href={this.props.registerLink}>Register Now!</RegisterButton>
      </Wrapper>
    );
  }
}

export default CampCard;
